import styled from "styled-components";

export const ShoppingCart = styled.aside`
  height: 20%;
  width: 100%;

  header {
    width: 100%;
    background-color: var(--color-primary);
  }

  .material-symbols-outlined {
    font-variation-settings: "FILL" 0, "wght" 400, "GRAD" 0, "opsz" 48;
  }
`;
